script: |
  super -f text -I q1451.spq | sort > q1451.out

inputs:
  - name: q1451.spq
    data: |
      SELECT DISTINCT * FROM tab1 (FORMAT parquet) AS cor0 WHERE col2 * + + ( col1 ) + + 14 - - ( 60 ) * col0 IS NOT NULL;
  - name: tab1

outputs:
  - name: q1451.out
    data: |
      51	14	96
      85	5	59
      91	47	68
